import React, {Component} from 'react';

class Button extends Component {
    render() {
        return(
            <div className={`column-${this.props.cols}`}>
                <button className="class-button" onClick={() => this.props.action(this.props.symbol)}>
                    {this.props.symbol}
                </button>
            </div>
        )
    }
}

export default Button;
